import './GoalItem.css'


function GoalItem() {
    return (
        <div className="text-center">
            <h2>Get an Internship</h2>
            <input className="pull-right" type="checkbox"></input>
            <h5>Achieve by: Date</h5>
            <p>This will help me become a future developer.</p>

        </div>
    )
}

export default GoalItem
